import React, { useState, useEffect } from "react";
import axios from "axios";

function Vozila(){

    const [vozila, setVozila] = useState([])

    useEffect(() => {
      const getVoziloData = async () => {
        const {data} = await axios.get('/api/aplikacija/getAllVozilo')
        //za testiranje, da li se ispisuju ispravo podaci iz baze
        console.log(data)
        //spremanje ispisa vozila iz baze pomoću setVozilo
        setVozila(data)
      }
      getVoziloData();
    }, []);


    return(
        <div>
        <div className="container py-5">
          <div className="row">
            <div className="col-12 text-center">
              <h1>Prikaz svih dostupnih vozila</h1>
              <hr />
            </div>
          </div>
        </div>
        <div className="container">
          <div className="row justify-content-around">
          <div className="card my-5 py-4">
            {
              vozila.map(Vozilo => {
                return 
                <div className="card-body text-center">
                <h5 className="card-title">{Vozilo.Marka}</h5>
                <p className="lead"> cijena u €</p>

            </div>
              })
            }

    </div>
          </div>
        </div>
      </div>
    )
}
export default Vozila;
